        <div className='header'>
            <div className='functionBar'><button className="btn" onClick={()=>this.operation}>&#9776;</button></div>
            <div className='title'>
                <h1 id="title1">Lotionmotion hello</h1>
                <p id="title2">Like Notion, but worse</p>
            </div>
        </div>
    );
};
export default Header;
